import React, { useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';

function AddEmployee() {
  // Tu si môžeš pripraviť stav pre všetky sekcie formulára
  const [personalData, setPersonalData] = useState({});
  const [contactData, setContactData] = useState({});
  const [addresses, setAddresses] = useState({});
  const [marketing, setMarketing] = useState({});

  const handlePersonalChange = (e) => {
    setPersonalData({ ...personalData, [e.target.name]: e.target.value });
  };
  const handleContactChange = (e) => {
    setContactData({ ...contactData, [e.target.name]: e.target.value });
  };
  const handleAddressChange = (e) => {
    setAddresses({ ...addresses, [e.target.name]: e.target.value });
  };
  const handleMarketingChange = (e) => {
    setMarketing({ ...marketing, [e.target.name]: e.target.checked });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Tu spracuj všetky údaje naraz
    const data = {
      ...personalData,
      ...contactData,
      ...addresses,
      ...marketing
    };
    // Odoslanie dat na backend
    alert(JSON.stringify(data, null, 2));
  };

  return (
    <div className="container mt-5">
      <h2>Pridať zamestnanca</h2>
      <form onSubmit={handleSubmit}>
        <Tabs>
          <TabList>
            <Tab>Osobné údaje</Tab>
            <Tab>Kontaktné údaje</Tab>
            <Tab>Adresy</Tab>
            <Tab>Marketing</Tab>
          </TabList>

          <TabPanel>
            <div>
              <label>Meno:</label>
              <input name="meno" type="text" onChange={handlePersonalChange} />
              <br/>
              <label>Priezvisko:</label>
              <input name="priezvisko" type="text" onChange={handlePersonalChange} />
              <br/>
              <label>Dátum narodenia:</label>
              <input name="datumNarodenia" type="date" onChange={handlePersonalChange} />
              {/* ďalšie osobné polia */}
            </div>
          </TabPanel>
          <TabPanel>
            <div>
              <label>Email:</label>
              <input name="email" type="email" onChange={handleContactChange} />
              <br/>
              <label>Telefón:</label>
              <input name="telefon" type="tel" onChange={handleContactChange} />
              {/* ďalšie kontaktné polia */}
            </div>
          </TabPanel>
          <TabPanel>
            <div>
              <label>Trvalá adresa:</label>
              <input name="trvalaAdresa" type="text" onChange={handleAddressChange} />
              <br/>
              <label>Korešpondenčná adresa:</label>
              <input name="korespondecnaAdresa" type="text" onChange={handleAddressChange} />
            </div>
          </TabPanel>
          <TabPanel>
            <div>
              <label>
                <input name="newsletter" type="checkbox" onChange={handleMarketingChange} />
                Odoberať newsletter
              </label>
              <br/>
              <label>
                <input name="suhlas" type="checkbox" onChange={handleMarketingChange} />
                Súhlas so spracovaním údajov
              </label>
              {/* ďalšie marketingové polia */}
            </div>
          </TabPanel>
        </Tabs>
        <br />
        <button type="submit" className="btn btn-primary">Uložiť zamestnanca</button>
      </form>
    </div>
  );
}

export default AddEmployee;
